package strings;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Anagrams {


    public static void main(String args[]) {
        char str1[] = {'t', 'e', 's', 't'};
        char str2[] = {'t', 't', 'e', 'w'};
        if (areAnagram(str1, str2))
            System.out.println("The two strings are"
                    + " anagram of each other");
        else
            System.out.println("The two strings are not"
                    + " anagram of each other");


        System.out.println(isAnagram("",
                ""));
    }

    //nlogn
    private static boolean areAnagram(char[] str1, char[] str2) {

        if (str1.length != str2.length)
            return false;

        Arrays.sort(str1);
        Arrays.sort(str2);

        for (int i = 0; i < str1.length; i++) {
            if (str1[i] != str2[i])
                return false;
        }

        return true;
    }

    //n
    private static boolean areAnagram2(char[] str1, char[] str2) {

        if (str1.length != str2.length)
            return false;

        int letterCount1[] = new int[128];
        int letterCount2[] = new int[128];


        for (int i = 0; i < str1.length; i++) {
            letterCount1[str1[i]]++;
            letterCount2[str2[i]]++;
        }

        for (int i = 0; i < letterCount1.length; i++) {
            if (letterCount1[i] != letterCount2[i]) {
                return false;
            }
        }

        return true;


    }

    public static boolean isAnagram(String s, String t) {

        if (s.length() != t.length())
            return false;

        if (s.length() == 0 && t.length() == 0)
            return true;

        HashMap<Character, Integer> countMap = new HashMap();

        for (Character c1 : s.toCharArray()) {
            countMap.put(c1, countMap.getOrDefault(c1, 0) + 1);
        }


        for (Character c2 : t.toCharArray()) {
            countMap.put(c2, countMap.getOrDefault(c2, 0) - 1);
        }

        for (Map.Entry<Character, Integer> entry : countMap.entrySet()) {
            if (entry.getValue().intValue() != 0)
                return false;
        }

        return true;
    }
}
